import React, {Component} from "react";
import "../styles/user-form.css";

class UserProfileComponent extends Component {

  userDataElement = () => {
    return (
      <div>
        <div>User Name: {this.props.name}</div>
        <div>User Email: {this.props.email}</div>
      </div>
    )
  }

  defaultElement = () => {
    return (
      <div>User Data Not Found. Please Submit use info in the form above.</div>
    )
  }

  assessDisplayElement = () => {
    return this.props.formSubmitted? this.userDataElement : this.defaultElement;
  }

  render() {
    return (
      <div>
        assessDisplayElement
      </div>
    );
  }
}

export default UserProfileComponent;
